INSERT INTO `event_details` (`EventID`, `EventName`, `EventDate`, `EventTime`, `EventCategory`, `EventDescription`, `EventTicketPrice`, `EventTicketTotal`, `EventTicketSold`, `VenueID`, `UserID`) VALUES
(1, 'Convocation', '2020-08-31', '00:00:00', 'Degree Celebration', 'The ceremony was graced by the presence of Sh. Anuj Khanna, Managing Director,C&S Electric Limited & Chairman, Western UP Zonal Council, Confederation of Indian Industry (CII) and Dr. Vinay Kumar Pathak, Hon’ble Vice Chancellor, Dr. A.P.J. Abdul Kalam Technical University, Lucknow, Members of Management Committee, Director, Heads of Departments, Deans, Section Incharges, faculty, staff, guests, parents of degree recipients, press and the graduating students.\r\n\r\nPresenting the College annual report, Director Dr. R.K. Agarwal highlighted the progress of the College and various academic, cultural, social and sports achievements of the students at College as well as University level.\r\n\r\nHon’ble Vice Chancellor, AKTU, Dr. Vinay Kumar Pathak conferred the degrees. The meritorious students were presented cash awards and certificates by the Chief Guest and the Vice Chancellor.\r\n\r\nIn his address to the students, the Vice Chancellor appreciated the academic achievements of the college with 18 students being in the branch wise merit lists of AKTU and a record tally of 3 Gold, 1 Silver and 2 Bronze medals. He emphasized on the significance of the Convocation Ceremony and advised the students to be focused towards their professional and social goals.', 5, 50000, 2, 2, 'AUTAR002'),
(2, 'Movie Night: Aladdin 2019', '2019-08-18', '22:00:00', 'Movie, Gathering', 'Aladdin is a lovable street urchin who meets Princess Jasmine, the beautiful daughter of the sultan of Agrabah. While visiting her exotic palace, Aladdin stumbles upon a magic oil lamp that unleashes a powerful, wisecracking, larger-than-life genie. As Aladdin and the genie start to become friends, they must soon embark on a dangerous mission to stop the evil sorcerer Jafar from overthrowing young Jasmine\'s kingdom.', 16, 300, 2, 3, 'AUTAR001'),
(3, '11TH MBA INTERNATIONAL BADMINTON CHAMPIONSHIP 2019', '2019-07-26', '08:00:00', 'Sports', 'Players from 16 countries enjoy a game of badminton at the recently concluded 10th Michael’s Badminton Academy (MBA) International Championships held in Port Dickson, Negeri Sembilan recently. \r\n\r\nA total of 700 players from Canada, Denmark, Bangladesh, Japan, Iraq, India, Indonesia, Hong Kong, Macau, Maldives, Sri Lanka, Singapore, Philippines, Vietnam and Thailand competed in junior, senior and veteran age group categories. ', 50, 1000, 1, 5, 'AUTAR001'),
(4, 'MEGA CAREERS & STUDY FAIR (MCASF 12th edition) ', '2019-08-24', '10:00:00', 'Fair', 'Mega Careers & Study Fair (MCASF) is a 3-in-1 career and postgraduate fair that brings together the best companies and universities, all under one roof.', 12, 50000, 1, 1, 'AUTAR002'),
(5, 'Fresher Party', '2019-12-30', '21:00:00', 'Concert, Entertainment', 'Ajay Kumar Garg Engineering College always aims to provide students a comfortable surrounding and encourage them to excel and prosper in their life. With this theme, the college commemorated the new beginning of first year students by building a friendly atmosphere for the freshmen and welcoming them for their exciting journey ahead with an evening of exuberance.\r\n\r\nFresher’s party is a gracious and a cordial welcome by the second year students to the first year students. It is an event where freshers are not only given a chance to exhibit their talents but also feel comfortable and adapt to the new surroundings. With this spirit, AANAVYA 2018 was organized on 19-09-2018 to felicitate the first year students for the new journey ahead.\r\n\r\nThe event was graced by the presence of Director R.K. Agarwal and HoDs of various departments. A series of amazing performances were put up by the 2nd year students, a fiesta consisting of dance, dramatics, fashion show and singing performances.\r\n\r\nThe event wouldn’t have been a huge success without the valuable efforts of Prof. V.K. Parashar, DSW who constantly aided the 2nd year students in organizing this grand fiesta. The Director addressed the first year with his esteemed words of wisdom and encouraged them to excel in all spheres of life.\r\n', 500, 15000, 4, 6, 'AUTAR001'),
(6, 'MoonDance @ SkySymphony', '2019-08-10', '00:30:00', 'Festival', '3, 2, 1â€¦ and blast off! To the moon goes Gentingâ€™s Highland Heroes! Joined by adorable Moon Bunnies, be immersed in an epic outer space dance party, where stunning visuals are paired with catchy tunes and dynamic winch balls for an upbeat, show-stopping performance. \r\n\r\nShow runs every half an hour.', 0, 10000, 3, 7, 'AUTAR005'),
(7, 'How to Train Your Dragon: The Hidden World', '2019-09-19', '21:30:00', 'Movie', 'From DreamWorks Animation comes a surprising tale about growing up, finding the courage to face the unknownâ€¦and how nothing can ever train you to let go. What began as an unlikely friendship between an adolescent Viking and a fearsome Night Fury dragon has become an epic adventure spanning their lives. Welcome to the most astonishing chapter of one of the most beloved animated franchises in film history: How to Train Your Dragon: The Hidden World. Now chief and ruler of Berk alongside Astrid, Hiccup has created a gloriously chaotic dragon utopia. When the sudden appearance of female Light Fury coincides with the darkest threat their village has ever faced, Hiccup and Toothless must leave the only home theyâ€™ve known and journey to a hidden world thought only to exist in myth. As their true destines are revealed, dragon and rider will fight together -- to the very ends of the Earth -- to protect everything theyâ€™ve grown to treasure. For How to Train Your Dragon: The Hidden World, series director Dean DeBlois returns alongside the all-star cast. The film is produced by Brad Lewis (Ratatouille, ANTZ) and Bonnie Arnold (Toy Story, How to Train Your Dragon,How to Train Your Dragon 2).', 16, 200, 3, 3, 'AUTAR001'),
(8, 'Alumni Meet', '2020-03-15', '00:00:00', 'Ownership', 'One of the strengths of AKGEC is, and has always been, its alumni. To establish, maintain and nurture a sustained, lifelong, and mutually beneficial relationship with its alumni, AKGEC formed an Alumni Association in 2005. Since its formation, the college has been actively involved in facilitating networking amongst alumni for social and professional synergy. AKGEC organized its first annual alumni meet on 02 April, 2005.\r\n\r\nKeeping with the tradition, this year too, the alumni association has successfully organized the 15th Alumni Meet on 16th March 2019. The alumni meet was conducted in the Vedanta farms, adjoining the college campus. The meet was marked by the presence of around 250 alumni from 2002 to 2018 batches. Many Alumni visited with families.', 150, 10000, 1, 6, 'AUTAR001');

